$.aH7=function(){var s=t.N
return A.b([A.a_(["title","Sobre o Aplicativo","description",'Este aplicativo web, faz parte da Disserta\xe7\xe3o de Mestrado intitulada: Roteiros Imag\xe9ticos no ensino de Hist\xf3ria para Surdos: Uma proposta Hist\xf3rico-cr\xedtica, como requisito para conclus\xe3o do Mestrado Profissional em Educa\xe7\xe3o (PPEd) do Programa de P\xf3s-gradua\xe7\xe3o em Educa\xe7\xe3o da Universidade Estadual do Norte do Paran\xe1 (UENP). Esta iniciativa \xe9 resultado de uma pesquisa-a\xe7\xe3o realizada em 2024 com egressos Surdos do Centro Educacional Especializado "Carlos Neufert" que j\xe1 atingiram a maioridade e que j\xe1 conclu\xedram os anos finais do ensino fundamental, localizado no munic\xedpio de Jacarezinho, no estado do Paran\xe1. A pesquisadora \xe9 Historiadora e docente da disciplina de Libras na UENP, nos cursos de Hist\xf3ria, Letras, Pedagogia e Fisioterapia, al\xe9m de j\xe1 ter atuado como Tradutora/Int\xe9rprete de Libras e Portugu\xeas (TILSP) na escola comum.\n          \nA motiva\xe7\xe3o para o desenvolvimento deste produto decorre da experi\xeancia da autora como TILSP na educa\xe7\xe3o b\xe1sica e, posteriormente, como docente no curso de Licenciatura em Hist\xf3ria. A necessidade de adaptar os conte\xfados de maneira acess\xedvel e eficaz torna-se cada vez mais premente, considerando que estudantes surdos est\xe3o inseridos em escolas regulares, em salas comuns, mas frequentemente enfrentam barreiras que comprometem seu aprendizado.\n          \nO desenvolvimento da pesquisa foi constitu\xeddo por um grupo de estudos, que abarcou uma forma\xe7\xe3o continuada com certifica\xe7\xe3o para os participantes, no qual foi estruturado com base na Pedagogia Hist\xf3rico-Cr\xedtica, na Pedagogia Visual e em pr\xe1ticas acess\xedveis, como o uso de roteiros imag\xe9ticos para o ensino de Hist\xf3ria, garantindo uma abordagem metodol\xf3gica que considera as especificidades da aprendizagem de estudantes surdos. A pesquisa seguiu um percurso formativo fundamentado na metodologia dial\xe9tica de Gasparin, derivada da proposta did\xe1tica da Pedagogia Hist\xf3rico-Cr\xedtica de Saviani, e organizada em cinco etapas: Pr\xe1tica Social Inicial, Problematiza\xe7\xe3o, Instrumentaliza\xe7\xe3o, Catarse e Pr\xe1tica Social Final\n          \nPara o planejamento dos encontros do Grupo, foram selecionados e discutidos textos fundamentais, incluindo A Constru\xe7\xe3o do Pensamento e da Linguagem de Vygotsky (2009) e obras de Saviani, como Escola e Democracia (2003, 2009) e Pedagogia Hist\xf3rico-Cr\xedtica (2013). Os participantes tiveram acesso a materiais escritos, discuss\xf5es em Libras e imagens ilustrativas em slides. Al\xe9m disso, foi utilizada uma revis\xe3o integrativa com textos de Lib\xe2neo (1994), Yokoyama (2005), Verri e Alegro (2006), e Kelman, Martins e Taveira (2012), abordando propostas de adapta\xe7\xf5es pedag\xf3gicas e relatos de experi\xeancias dos participantes.\n          \nA apresenta\xe7\xe3o do prot\xf3tipo do aplicativo incluiu um v\xeddeo demonstrativo explorando suas funcionalidades e o conte\xfado adaptado sobre a Revolu\xe7\xe3o Industrial, estruturado em roteiro imag\xe9tico com gloss\xe1rio de palavras-chave.\n          \nO estudo sobre inclus\xe3o foi embasado na obra Tenho um Aluno Surdo e Agora? com recortes dos cap\xedtulos sobre educa\xe7\xe3o inclusiva e estrat\xe9gias metodol\xf3gicas para o ensino de surdos. Al\xe9m disso, foram analisadas legisla\xe7\xf5es pertinentes, como a Lei 10.436/2002, o Decreto 5.626/2005, a Lei 12.319/2010 e a Lei 14.191/2021. Durante os encontros, utilizaram-se v\xeddeos, pr\xe1ticas acess\xedveis, apresenta\xe7\xf5es em Libras e materiais de apoio para promover a reflex\xe3o e o debate em conjunto. Todas as etapas foram acompanhadas de slides adaptados e di\xe1rios de anota\xe7\xf5es para registro das discuss\xf5es e contribui\xe7\xf5es dos participantes.\n          \nA coleta de dados possibilitou a compreens\xe3o das pr\xe1ticas sociais dos participantes, seguida por momentos de estudo e instrumentaliza\xe7\xe3o, que culminaram na aplica\xe7\xe3o dos conhecimentos adquiridos e na avalia\xe7\xe3o da proposta pelos participantes, que promoveu um desenvolvimento mais aprimorado e de acordo com as opini\xf5es dos Surdos do produto.\n          \nO produto foi desenvolvido com foco na praticidade e na usabilidade, proporcionando uma navega\xe7\xe3o intuitiva e acess\xedvel para os professores, que frequentemente enfrentam uma elevada carga de trabalho. A integra\xe7\xe3o da tecnologia no contexto educacional n\xe3o apenas otimiza o tempo e a produtividade docente, mas tamb\xe9m amplia as possibilidades pedag\xf3gicas, permitindo a diversifica\xe7\xe3o dos m\xe9todos de ensino e a personaliza\xe7\xe3o do aprendizado.',"video","https://youtu.be/Ba5dc4MWxQs?si=PnPd1644MbGGmdvm"],s,s)],A.at("C<az<l,l>>"))}()
